import React, { useState } from 'react'
import './AddNewProduct.css'
import { MdOutlineDriveFileRenameOutline } from "react-icons/md";
import { FaDollarSign } from "react-icons/fa";
import { BsBoxSeam } from "react-icons/bs";
import { FaLink } from "react-icons/fa";
import { FaRegStar } from "react-icons/fa";
import { BiCoinStack } from "react-icons/bi";
import { IoColorPaletteOutline } from "react-icons/io5";
import { ToastContainer, toast } from 'react-toastify';
import 'react-toastify/dist/ReactToastify.css';


export default function AddNewProduct() {
    const [newTitle, setNewTitle] = useState("")
    const [newPrice, setNewPrice] = useState("")
    const [newCount, setNewCount] = useState("")
    const [newaddres, setNewaddres] = useState("")
    const [newPopularValue, setNewPopularValue] = useState("")
    const [newCell, setNewCell] = useState("")
    const [newColors, setNewColors] = useState("")

    let newProductsInfos = {
        title: newTitle,
        price: newPrice,
        count: newCount,
        img: newaddres,
        popularity: newPopularValue,
        sale: newCell,
        colors: newColors
    }


    const notify = () => toast("محصول جدید  با موفقیت به فروشگاه اضافه شد");


    const addNewProduct = (event) => {

        event.preventDefault()

        fetch(`http://localhost:8000/api/products`, {
            method: 'POST',
            headers: {
                'Content-Type': 'application/json'
            },
            body: JSON.stringify(newProductsInfos)
        }).then(res => res.json())
        .then(result => {
            console.log(result);
            notify()

        })
    }

    return (
        <div className='products-main'>
            <h1 className='products-title'>افزودن محصول جدید</h1>

            <form action="#" className='add-products-form'>
                <div className='add-products-form-wrap'>
                    <div className='add-products-form-group'>
                        <MdOutlineDriveFileRenameOutline />

                        <input type="text"
                            placeholder='اسم محصول را بنویسید'
                            className='add-products-input'
                            value={newTitle}
                            onChange={(e) => setNewTitle(e.target.value)} />
                    </div>
                    <div className='add-products-form-group'>
                        <FaDollarSign />

                        <input type="text"
                            placeholder='قیمت محصول را بنویسید'
                            className='add-products-input'
                            value={newPrice}
                            onChange={(e) => setNewPrice(e.target.value)} />
                    </div>
                    <div className='add-products-form-group'>
                        <BsBoxSeam />

                        <input type="text"
                            placeholder='موجودی محصول را بنویسید'
                            className='add-products-input'
                            value={newCount}
                            onChange={(e) => setNewCount(e.target.value)} />
                    </div>
                    <div className='add-products-form-group'>
                        <FaLink />
                        <input type="text"
                            placeholder='آدرس عکس محصول را بنویسید'
                            className='add-products-input'
                            value={newaddres}
                            onChange={(e) => setNewaddres(e.target.value)} />
                    </div>
                    <div className='add-products-form-group'>
                        <FaRegStar />

                        <input type="text"
                            placeholder='میزان محبوبیت محصول را بنویسید'
                            className='add-products-input'
                            value={newPopularValue}
                            onChange={(e) => setNewPopularValue(e.target.value)} />
                    </div>
                    <div className='add-products-form-group'>
                        <BiCoinStack />

                        <input type="text"
                            placeholder='میزان فروش محصول را بنویسید'
                            className='add-products-input'
                            value={newCell}
                            onChange={(e) => setNewCell(e.target.value)} />
                    </div>
                    <div className='add-products-form-group'>
                        <IoColorPaletteOutline />

                        <input type="text"
                            placeholder='تعداد رنگ بندی محصول را بنویسید'
                            className='add-products-input'
                            value={newColors}
                            onChange={(e) => setNewColors(e.target.value)} />
                    </div>
                </div>
                <button className='add-products-submit' onClick={addNewProduct}>ثبت محصول</button>
            </form>
        </div>
    )
}
